import React from "react";
import style from './Dialogs.module.css';

const Dialogs = () => {
    return (
        <div className={style.dialogWindow}>
            <div className={style.dialogs}>
                <div className={style.dialog}>name1</div>
                <div className={style.dialog}>name2</div>
                <div className={style.dialog}>name3</div>
                <div className={style.dialog}>name4</div>
                <div className={style.dialog}>name5</div>
                <div className={style.dialog}>name6</div>
            </div>
            <div className={style.messages}>
                <div className={style.msg}>Message1</div>
                <div className={style.msg}>Message2</div>
                <div className={style.msg}>Message3</div>
            </div>
        </div>
    )
}

export default Dialogs;
